import React from 'react';

const Dashboard = () => {
    return (
        <div>
            <h1>Bienvenido a la nueva página</h1>
            <p>Has iniciado sesión con éxito.</p>
            <li onClick={()=>{setMenu("edit")}} ><Link style={{textDecoration:'none'}} to= '/edit'>Editar</Link>{menu==="edit"?<hr/>:<></>} </li>
        </div>
    );
};

export default Dashboard;
